    render(){
        //get nav data from its parent 'App'
        const Nav = this.props.nav.map((navItem,i) => {
            return(
            <li key={i}>{navItem}</li>
            );
        })
        return(
            <nav className="nav"> 
              <div className="container">



    <input type="checkbox" />


    <span></span>
    <span></span>
    <span></span>

    <ul id="menu">
      <a href="#"><li>Home</li></a>
      <a href="#"><li>About</li></a>
      <a href="#"><li>Info</li></a>
      <a href="#"><li>Contact</li></a>
    </ul>

              </div>           
            </nav>
        );
    }
}

export default Nav;
